import React from 'react';
import './App.css';
import TestApi from './components/TestApi';
import Navigation from './components/Navigation';
import Slideshow from './components/Slideshow';
import {Image} from 'react-bootstrap';
import FooterPage from './components/FooterPage';

function App() {
  return (
    <div className="App">
      <Navigation/>
      <Image className="bgi" src="https://images.unsplash.com/Ys-DBJeX0nE.JPG?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1950&q=80"flued />
      {/* <Slideshow/> */}
      <TestApi/>
      <FooterPage/>
    </div>
  );
}

export default App;
